menu.add_feature("Ped Heist Manager","value_str", TOOLS.id ,function(feat)
    while feat.on do
        if feat.value == 0 then
            for i, pedd in pairs(ped.get_all_peds()) do
                if not ped.is_ped_a_player(pedd) then
                    ped.set_ped_health(pedd, 1)
                end
            end
        end
        system.wait(0)
    end

    if feat.value == 1 then
        for i, pedd in pairs(ped.get_all_peds()) do
            if not ped.is_ped_a_player(pedd)  then
                entity.delete_entity(pedd)
            end
        end
    end

    if feat.value == 2 then
        for i, pedd in pairs(ped.get_all_peds()) do
            if not ped.is_ped_a_player(pedd) then
                while not network.has_control_of_entity(pedd) and utils.time_ms() + 500 > utils.time_ms() do 
                    system.wait(0)
                end
                ped.resurrect_ped(pedd)
                ped.clear_ped_tasks_immediately(pedd)
                ped.set_ped_health(pedd, 150.0)
                ped.set_ped_max_health(pedd, 90000)
            end
        end
    end
end):set_str_data {"Kill", "Remove", "Resurrect"}


