local function a(b, c, d, e)
    e = e or true
    local f, g = b
    if c then
        f = "MP0_" .. b
        g = "MP1_" .. b
        g = gameplay.get_hash_key(g)
    end
    f = gameplay.get_hash_key(f)
    local h, i = stats.stat_get_float(f, -1)
    if h ~= d then
        stats.stat_set_float(f, d, e)
    end
    if c then
        local j, i = stats.stat_get_float(g, -1)
        if j ~= d then
            stats.stat_set_float(g, d, e)
        end
    end
end
