MU(
    CHAR_DATE_EDIT .. "",
    "action",
    CHAR_DATE_MNGER.id,
    function(O)
        local P = native.ByteBuffer64()
        local Q, R = input.get("Year | Example: 2015", "", -1, 3)
        while Q == 1 do
            Q, R = input.get("Use only numbers", "", -1, 3)
            system.wait(0)
        end
        local S, T
        if Q == 0 then
            S, T = input.get("Month | Example: 05", "", -1, 3)
            while S == 1 do
                S, T = input.get("Use only numbers", "", -1, 3)
                system.wait(0)
            end
            local U, V
            if Q == 0 then
                U, V = input.get("Day | Example 22", "", -1, 3)
                while U == 1 do
                    U, V = input.get("Use only numbers", "", -1, 3)
                    system.wait(0)
                end
            end
            P:fill(tonumber(R), tonumber(T), tonumber(V))
            native.call(0x2C29BFB64F4FCBE4, gameplay.get_hash_key(n .. "_CHAR_DATE_CREATED"), P, 7, -1)
            MN(
                string.format(
                    "Year: %i\nMonth: %i\nDay: %i\nHour: %i\nMinute: %i\nSecond: %i\nMillisecond: %i",
                    P:__tointeger64(0),
                    P:__tointeger64(1),
                    P:__tointeger64(2),
                    P:__tointeger64(3),
                    P:__tointeger64(4),
                    P:__tointeger64(5),
                    P:__tointeger64(6),
                    P:__tointeger64(7)
                )
            )
        end
    end
)

