 function get_collision_vector(m, Ped)
     me = player.get_player_coords(m)
     pos, rot = me, cam.get_gameplay_cam_rot()
    rot:transformRotToDir()
     pos = rot * 1000 + pos
     n, Pos = worldprobe.raycast(me, pos, -1, Ped)
     d = me - Pos
    return Pos, math.abs(d.x) + math.abs(d.y), pos
end
