               if all_session_flags_count > 0 then
                   all_session_flags = all_session_flags .. ", " .. "Modified Session State B1"
               else
                   all_session_flags = all_session_flags .. "Modified Session State B1"
               end
               modified_session_state_c1 = true
               all_session_flags_count = all_session_flags_count + 1
           end
       end
       if all_session_flags_count == 0 then
           menu.notify("Session Broken: False\nFlags: None", Zeus, 12, 0x00ff00)
       else
           menu.notify("Session Broken: True\nFlags: " .. all_session_flags .. "", Zeus, 12, 211)
       end
   else
       menu.notify("Session Broken: False\nFlags: None", Zeus, 12, 0x00ff00)
   end
end)

