RapidRespawn =
menu.add_feature("Rapid Respawn", "toggle", misc.id, function(f)
	if f.on then
		while f.on do
			system.yield(0)
			if network.is_session_started() then
				if entity.is_entity_dead(player.get_player_ped(player.player_id())) then
					ped.resurrect_ped(player.get_player_ped(player.player_id()))
					ped.set_ped_max_health(player.get_player_ped(player.player_id()), 328)
					ped.set_ped_health(player.get_player_ped(player.player_id()), 328)
					local success, spawn_point = gameplay.find_spawn_point_in_direction(player.get_player_coords(player.player_id()), player.get_player_coords(player.player_id()), (0))
					if spawn_point ~= nil then
						for i = 1, 50 do
							entity.set_entity_coords_no_offset(player.get_player_ped(player.player_id()), spawn_point + v3(0, 0, 1))
						end
					else
						for i = 1, 50 do
							ped.clear_ped_tasks_immediately(player.get_player_ped(player.player_id()))
						end
					end
				end
			end
		end
	end
end)
RapidRespawn.on = false


local IsPlayerDead = {}
local IsPlayerAlive = {}
killtracker =
    menu.add_feature("Kill Tracker", "toggle", misc.id, function(f, pid)
        if f.on then
            while f.on do
                system.yield(100)
                for pid = 0, 31 do
                    if entity.is_entity_dead(player.get_player_ped(pid)) then
                        if not IsPlayerDead[pid] then
                            for pid2 = 0, 31 do
                                if entity.has_entity_been_damaged_by_entity(player.get_player_ped(pid), player.get_player_ped(pid2)) then
                                    if player.is_player_valid(pid) and player.is_player_valid(pid2) then
                                        if pid == pid2 then
                                            if player.is_player_female(pid) then
                                                menu.notify(tostring(player.get_player_name(pid2)) .. " Killed Herself", "Kill Tracker", 4, 0x64FA7800)
                                            else
                                                menu.notify(tostring(player.get_player_name(pid2)) .. " Killed Himself", "Kill Tracker", 4, 0x64FA7800)
                                            end
                                        elseif pid ~= pid2 then
                                            menu.notify("Player: " .. tostring(player.get_player_name(pid2)) .. "\nKilled: " .. tostring(player.get_player_name(pid)), "Kill Tracker", 4, 0x64FA7800)
                                        end
                                    end
                                end
                                system.wait(0)
                            end
                        end
                        IsPlayerDead[pid] = true
                        IsPlayerAlive[pid] = false
                    elseif not entity.is_entity_dead(player.get_player_ped(pid)) and IsPlayerDead[pid] then
                        IsPlayerDead[pid] = false
                        IsPlayerAlive[pid] = true
                    end
                    system.wait(0)
                end
            end
        end
    end)
killtracker.on = true


enableLog = 
