 function SendNotif(msg)
    menu.notify(msg, "Evelyn DP-Emotes", 10)
end

 function DestroyAllProps()
    for i = 1, #PlayerProps do
         ent = PlayerProps[i]
        if entity.is_an_entity(ent) then
            if network.has_control_of_entity(ent) then
                entity.delete_entity(ent)
            else
                for tries = 0, 100 do
                    if not entity.is_an_entity(ent) then
                        break
                    end
                    network.request_control_of_entity(ent)
                    if network.has_control_of_entity(ent) then
                        entity.delete_entity(ent)
                        break
                    end
                    system.wait(1)
                end
            end
        end
    end
    PlayerHasProp = false
    print("Destroyed Props")
end

 function AddPropToPlayer(propmodel, bone, off1, off2, off3, rot1, rot2, rot3)
     pped = player.get_player_ped(-1)
     pcoords = entity.get_entity_coords(pped) + v3(0.0, 0.0, 0.2)
    propmodel = tonumber(propmodel) or gameplay.get_hash_key(propmodel)

    if not streaming.has_model_loaded(propmodel) then
        streaming.request_model(propmodel)
        while not streaming.has_model_loaded(propmodel) do
            system.yield(0)
        end
    end

     prop = object.create_object(propmodel, pcoords, true, true, true)
    entity.attach_entity_to_entity(
        prop,
        pped,
        ped.get_ped_bone_index(pped, bone),
        v3(off1 or 0.0, off2 or 0.0, off3 or 0.0),
        v3(rot1 or 0.0, rot2 or 0.0, rot3 or 0.0),
        false,
        false,
        false,
        1,
        true
    )
    table.insert(PlayerProps, prop)
    PlayerHasProp = true
    streaming.set_model_as_no_longer_needed(propmodel)
end

