 function EmoteCancel()
     pped = player.get_player_ped(-1)
    if ChosenDict == "MaleScenario" and IsInAnimation then
        ped.clear_ped_tasks_immediately(pped)
        IsInAnimation = false
        print("Forced scenario exit")
    elseif ChosenDict == "Scenario" and IsInAnimation then
        ped.clear_ped_tasks_immediately(pped)
        IsInAnimation = false
        print("Forced scenario exit")
    end

    PtfxNotif = false
    PtfxPrompt = false

    if IsInAnimation then
        --   PtfxStop()
        ped.clear_ped_tasks_immediately(pped)
        DestroyAllProps()
        IsInAnimation = false
    end
end

 function LoadAnim(dict)
    while not streaming.has_anim_dict_loaded(dict) do
        streaming.request_anim_dict(dict)
        system.wait(0)
    end
end

 function CheckGender()
     hash = entity.get_entity_model_hash(player.get_player_ped(-1))
    if hash == gameplay.get_hash_key("mp_m_freemode_01") then
        return "male"
    elseif hash == gameplay.get_hash_key("mp_f_freemode_01") then
        return "female"
    end
end

