event.add_event_listener(
    "chat",
    function(event)
        if event.player ~= player.player_id() then
            return
        end
        if event.body:find("/e ") then
             name = event.body:gsub("/e ", "")
            if name == "c" or name == "cancel" then
                return EmoteCancel()
            end

            if DP.Emotes[name] ~= nil then
                return OnEmotePlay(DP.Emotes[name])
            elseif DP.Dances[name] ~= nil then
                return OnEmotePlay(DP.Dances[name])
            elseif DP.PropEmotes[name] ~= nil then
                return OnEmotePlay(DP.PropEmotes[name])
            else
                return SendNotif("'" .. name .. "' is not a valid emote!")
            end
        elseif event.body:find("/dance") then
            playDance(tonumber((event.body:gsub("/dance ", ""))))
        end
    end)
