-- Cause a player to cosmetically bleed out
menu.add_player_feature("Cosmetic Bleed Out", "toggle", trolls.id, function(playerfeat_toggle, pid)
    menu.notify("Prolonged usage of this PTFX will cause the PTFX to no longer work until you change sessions.", "WARNING", 10, 0x000000ff)
    while playerfeat_toggle.on do
        graphics.set_next_ptfx_asset("core")
        while not graphics.has_named_ptfx_asset_loaded("core") do
            graphics.request_named_ptfx_asset("core")
            system.wait(0)
        end
        graphics.start_networked_ptfx_looped_on_entity("blood_stab", player.get_player_ped(pid), v3(0, 0.07, 0.3), v3(-50, 0, 0), 2)
        system.wait(1000)
    end
end)

menu.add_player_feature("Blind Player", "toggle", trolls.id, function(playerfeat_toggle, pid)
    menu.notify("Blinding " .. player.get_player_name(pid), troll_menu_ver)

    local ptfx_loaded = false
    local ptfx_executed = false
    graphics.set_next_ptfx_asset("core")
    if (ptfx_loaded == false or ptfx_executed == false) then
        ptfx_loaded = requestPTFX("core")
        ptfx_executed = true
    end

    while playerfeat_toggle.on do
        local flare_ptfx = graphics.start_networked_ptfx_looped_on_entity("exp_grd_flare", player.get_player_ped(pid), v3(0, 0.6, 0.45), v3(0, 0, 0), 2)
        system.wait(250)
        graphics.remove_particle_fx(flare_ptfx, true)
        return HANDLER_CONTINUE
    end

    if (not playerfeat_toggle.on) then
        graphics.remove_named_ptfx_asset("core")
        ptfx_loaded = false
        ptfx_executed = false
    end
end)


local function checknumber(_num)
    if _num ~= nil and tonumber(_num) ~= nil then
        return true
    end
    return false
end

local function text_input(_title,_default,_max,_type)
    local status,str=1
    while status == 1 do 
        system.yield(0)
        status, str = input.get(_title, _default, _max, _type)
    end
    return status,str
end

